INSERT INTO `Products` VALUES (4161,24,244,'ALFA LINK 2 USB CHARGER ACS 4','Fast Charging 2.4A Max\nOperating temperature : less than 60C\nStorage temperature : Room temperature\nTolerant humidity : (95 +/3)%\nInput Power : AC100-240V 50/60Hz 0.3A\nSize (mm) :51*45.8*25.9\nLife : 25000 hours \noutput power : DC5V-2.4A Max \nMaterial : Pc Fireproof material V0\nHigh Efficiency and safe output current',NULL,100,'2019-01-11 17:00:00',99000,4.5,1,299,'NEW'),(4162,24,139,'ALFA LINK 6800mA Fast Charging ACS 34','Specification : \n2x smart phones plus \n2x ipads/tablets \nInput : AC 100-240V \n	50/60Hz\nOutput : DC 5V,24A max X 2 Ports \n	   DC 5V,1A Max X 2 ports \n	   6.8A For Shared between 4x ports \n\n1. Quickly charger all ipods, iphones,ipads,Cell phones and any other usb devices, Universal solution to charger devices at the fast speed\n2. No Need for bulky power adaptor this one charger does it all \n3. Four standard usb ports and blue led indicator \n4. It has a foldable AC Plug for convenient storge and is supplied with a european AC Plug Adapter,Great For Travelling \n5. With Auto Switching  it supports AC 100-240V',NULL,160,'2019-02-18 17:00:00',229000,90,1,300,'NEW'),(4163,24,136,'ALFA LINK Bluetooth Earphone BTE 109 Plus','Single Side Wireless Headset \nDistance : Kurang kecil dr 10M \nVersion : V4.2 \nCharging Voltage : DC5V\nWorking Voltage : DC3.7V-4.2V\nBattery Capacity : 60mAh\nFrequency Range : 20Hz-20 Khz\nSpeaker Impedance : 32 ohm -/+ 10% \nLound speaker Size : Ohm 8mm\nRated Power : 2 mW\nSensitivity : 102 -/+ 3dB\nMicrophone : Bult  in',NULL,100,'2019-02-18 17:00:00',179000,90,1,100,'NEW'),(4164,24,136,'ALFA LINK Bluetooth Earphone BTE 115 Plus','Super Bass\nPower Switch \nTake Call/play/pause/automatic search\nPrevious Track/Volume -\nNext Track/Volume +\nUsb \nTF\n\nSpecification : \n\nDistance : Lbh kecil dr 10M\nVersion : V4.2\nCharging Voltage : DC5V\nWorking Voltage : DC3.7V \nBattery Capacity : 140mAh\nFrequency Range : 20Hz-20KHz\nSpeaker Impedance : 32 ohm -/+ 10%\nLoud Speaker Size : Ohm 10mm\nRated Power : 2mW *2\nSensitivity : 102 -/+ 3dB\nMicrophone : Bult  in',NULL,100,'2019-02-18 17:00:00',229000,90,1,100,'NEW'),(4165,24,244,'ALFA LINK Car Charger Set ACC 512','Input : DC 12V-24V\nOutput 1 : DC 5V,1A\nOutput 2 : DC 5V,2.1A',NULL,150,'2019-02-18 17:00:00',139000,92,1,16,'NEW'),(4166,24,136,'ALFA LINK Earphone AEP 34','Alfalink telah menghadirkan produk earphonetype Alfalink AEP 34 In-Ear Headphone, dengan Desain Menawan dan dengan warna yang menarik maka anda akan jauh lebih pede untuk mendengarkan Sebuah lagu dengan lirik dan melodi yang indah dapat Anda dengarkan dengan jelas dan jernih apabila menggunakan earphone ini.\n\nModel :AEP 34\nLength : 1200mm\nImpedance :32 ohm\nSensitivity : 90db+/3dB\nFrequency range : 20HZ  20KHZ\nRated Power : 3mw\nPlug : AUX 3.5mm\nHoom Size : 10mm\n\nColour : Black, White \n\nCATATAN : Cantumkan keterangan warna sebelum order jika tidak memberikan keterangan warna akan kami kirimkan warna RANDOM',NULL,100,'2019-02-18 17:00:00',99000,NULL,1,300,'NEW'),(4167,24,165,'ALFA LINK Electronic Dictionary EA 1545T','Translator ini menggunakan baterai Alkaline 2 AAA (Baterai tidak bisa di isi ulang) dan tersedia dalam unit ini.\nTranslator ini bisa juga di jalankan dengan USB sambungkan ke PC/Laptop.Perhatikan baterai tidak di isi ulang melalui USB.\nBisa di gunakan dengan micro USB adapter (tidak tersedia dalam unit) \n\nMicro SD Card dan USB \n\nAda slot micro SD di samping alat  bisa memasukan file txt atau memperbaharui sofware (jika ada) dari komputer anda ke SD Card, Sisipkan SD Card ke unit ini untuk membaca datanya.\n\nCatatan : Anda harus memadamkan unit ini terlebih dahulu sebelum memasukan atau mengeluarkan MSD Card Jika tidak pengaturan tidak akan tersimpan. \n\nUnit ini bisa di sambungkan ke komputer melalui kabel USB (tidak di sediakan) untuk memasukan file txt atau memperbaharui software (jika ada) Hanya tersedia sistem microsoft windows untuk fitur ini.\n\nTalking phrase book : \n\nComet indonesian, English, Chinese, Cantonese, Hokkien,Malay,Arabic,Japanese,Korean,Spanish, French,Dutch and German 13 Language \nCovers most common words, Phrases,idioms grammar,sentence patterns, and everyday expressions in all general categories such as business, Law and health etc.\n\nGrammar and learning course : \n\nContains English lessons and inflections \n10 English lessons and English Phonics designed by  professional English Teachers\n15 English classic novels with audio \n200 English Encyclopedic articles with audio \nEnglish Irreguler Verb Dictionary 840 Words\nEnglish Verb conjugation 7,000 headwords\nEnglish Noun inflection 30,000 headwords\nEnglish adjective inflection 12,000 headwords\nEnglish Synonym 15,000 Words, Antonym 12,000 Words\nEnglish Vocabulary, TOEFL, IELTS, GMAT, GRE, SAT, CET-4, CET-6, TEM-45, TEM-8 and TOEIC \nEnglish tests, TOEFL,GMAT,SAT,GRE, Primary, Grammar, and vocabulary \nGame tests of conjumania, Guess the word and hangman \nIntroduction of English Grammar and Tense',NULL,800,'2019-02-18 17:00:00',1989000,NULL,1,300,'NEW'),(4168,24,165,'ALFA LINK Electronic Dictionary EI 328 T','SPESIFICATION\nDevice Type: EI - 328T\nBattery Type: AAA\nLCD Colour: No\nLCD Display: 3 Line LCD Display\nSize: 10 x 7.2 x 1.6 cm\nWeight: 65 gram\nIt is also completed with 1 YEAR of Product Warranty.\n\nFEATURE\nPowerful, Simple and Blue Dot LCD Dictionary\n\n2 Bi - Lingual Dictionaries :\n -  English  -  Indonesian (Peter Salim)\n -  Indonesian  -  English (Peter Salim)       \n\n2 Mono - Lingual Dictionaries :\n -  Indonesia  -  Indonesia\n -  Mini  -  Thesaurus\n\n13 Categories of Conversation :\n -  Accommodation\n -  Travelling    \n -  Basic\n -  Business\n -  Communication\n -  Emergency\n -  Entertainment\n -  Food\n -  General Knowledge\n -  Human Being\n -  Living\n -  Meals\n -  Shopping\n\n8  -  Digits Calculator\n\nMetric Conversion\n\nCurrency Conversion\n\nMortgage Calculator\n\nFuture Value Calculator\n\nPDA  -  Personal Data Assistant\n -  Phone Book\n -  Schedule\n -  Note\n\nLocal/World Time\n\nTimer\n\nGame Centre\n\n\nCOLOUR : Purple (KOSONG), Green (Tersisa 2 Pcs)\n\nCATATAN : Cantumkan Keterangan warna sebelum order kepada kami, Jika tidak cantumkan warna akan kami beri warna Random.',NULL,300,'2019-02-18 17:00:00',269000,92,1,2,'NEW'),(4169,24,139,'ALFA LINK Flushing Cable Lightning','Fast charging 3A Data cable \ntype : Usb data cable (Single side can be used) \nSize : Wire length 1000 +/20mm PVC material \n(OD2.6mm 5.5mm*1000mm) \nStructure : twice forming durable and easy to use \nworking temperature : 10C to 35C \nStorage temperature : -30C to 70C \nTolerance humidity : lbh kecil 85% \nWire Length : 100Cm \nCurrent output : 5V-3.0A MAX\n\nColour : Black, White \n\nCatatan : Cantumkan Keterangan warna sebelum order jika tidak berikan warna akan di kirimkan warna RANDOM!!!',NULL,100,'2019-01-09 17:00:00',129000,NULL,1,300,'NEW'),(4170,24,139,'ALFA LINK Flushing Cable type C','Fast Charging 3A Data cable \nType : USB data Cable (Single side can be used) \nSize : Wire length 1000+/20mm PVC material \n(OD2.6mm 5.5mm*1000mm) \nStructure : Twice forming durable and easy to use \nworking temperature : 10C to 35c \nStorage temperature : -30C to 70C \nTolerance humidy : lbh kecil 85% \nCurrent output : 5V-3.0A Max \nwire length 100Cm \n\nColour : Black, White \n\nCATATAN : Cantumkan keterangan warna sebelum order jika tidak akan di kirimkan warna RANDOM!!!!',NULL,100,'2019-01-09 17:00:00',129000,NULL,1,300,'NEW'),(4171,24,139,'ALFA LINK Invisible Screen procektor','Ultra Scratch Resistant : \n\nAgar Anda bisa merasakan manfaat unik dari pelindung layar cair, kami telah mengembangkan aplikasi satu kali untuk telepon dengan layar kaca. Dengan perlindungan layar cair Nanofixit untuk ponsel, perangkat Anda akan menjadi anti gores dan terlindungi dari radiasi dan bakteri ponsel.\nPelindung layar Nanofixit telah diuji secara ilmiah dan disertifikasi dengan kekerasan 9H, membuat layar elektronik Anda sangat gores tahan terhadap pemakaian dan keausan sehari-hari.\n\nSpesfikasi : \nKotak berisi 3 sachet. Bungkus pertama berisi alas alkohol untuk membersihkan perangkat, yang kedua berisi pelindung layar cair dan yang ketiga adalah kain microfibre untuk menyemarakkan layar dan membuatnya bersinar.\n\nProses Aplikasi : \nBersihkan permukaan kaca dengan baik (30 detik) dengan alkohol bersih dari sachet \nno. 1.Buka sachet \nno. 2 dan oleskan pelindung layar cair. Gosok ke kaca, vertikal dan horizontal, menutupi seluruh permukaan selama sekitar 30 detik.Biarkan cairan menyerap selama 60 detik (Anda bisa menggunakan ponsel Anda seperti biasa selama ini). Kemudian bersihkan permukaan dengan kain microfiber sampai bersinar\n\nFitur Keren Lainnya : \nMengurangi lebih dari 90% radiasi ponsel\nSecara aktif membunuh kuman dan bakteri di layar\nMeningkatkan kejernihan layar (efek HD)\nMeningkatkan kualitas kamera dan foto yang diambil\nBekerja mulus dengan layar \'Touch 3D\'\nBerlangsung hingga 2 tahun\nRamah lingkungan\nMudah diterapkan\n100% gelembung gratis',NULL,100,'2019-01-03 17:00:00',159000,94,1,300,'NEW'),(4172,24,165,'ALFA LINK Langie Speaking Translator LST 52','Kini saatnya anda mencoba produk terobosan terbaru dari Alfa Link LANGIE Translator 52, kamus elektronik dengan voice online translate 52 bahasa dan 12 bahasa voice offline transalte dilengkapi juga multimedia,learn flash card,Al-Qur\'an dan masih banyak fitur yang lain. Anda cukup menyebutkan kata atau kalimat yang anda cari tanpa perlu repot\" untuk mengetik kata atau kalimat yang anda cari. Bentuknya yang sangat simple sangat mudah dibawa kemana saja. Sangat cocok untuk pelajar,mahasiswa,pegawai hotel,traveller,dan lain\". Jadi tunggu apalagi segera dapatkan produknya sekarang juga.\n\nVideo :\n/watch?v=zTYbjCZSO4k\n\nSpecification :\nCPU : ARM Cortex 1.3 GHz Quad Core\nLcd : TFT 1.08 Inch (27.5mm)\nBattery : 3.7V/2000 mAh\nWifi : 802.11 b/g/n\nUsb : Micro Usb Usb 2.0 OTG\nM